"const metaTags = () => Array.from(document.getElementsByTagName('meta'));
const findExistingViewport = (metaTags) => metaTags.find(element => element.getAttribute('name') === 'viewport')
const createViewport = () => document.createElement('meta');
const addViewportToHtml = (viewport) => document.getElementsByTagName('head')[0].appendChild(viewport);

const getViewport = () => {
  var viewport = findExistingViewport(metaTags());
  if (viewport !== undefined) {
    return viewport;
  }

  viewport = createViewport();
  addViewportToHtml(viewport);
  return viewport;
}

const viewport = getViewport();
viewport.content = 'user-scalable=0, width=device-width, initial-scale=1.0, minimum-scale=1.0, maximum-scale=1.0';
"

